import React from 'react';
import './Home.css';
import image1 from '../assets/image1.jpeg'; // Use your preferred image

const boxData = [
    { id: 1, title: "Box 1" },
    { id: 2, title: "Box 2" },
    { id: 3, title: "Box 3" },
    { id: 4, title: "Box 4" },
    { id: 5, title: "Box 5" },
    { id: 6, title: "Box 6" },
    { id: 7, title: "Box 7" },
    { id: 8, title: "Box 8" }
];

function Home() {
    return (
        <div className="home-page">
            <div className="image-container">
                <img src={image1} alt="Background" className="background-image rotate" />
                <div className="overlay-text">
                    <h1>Welcome to the GEC Alumni Association Platform</h1>
                    <p>Connecting Alumni, Supporting Growth, and Fostering Success.</p>
                    <button className="get-started-button">Get Started</button>
                </div>
            </div>

            {/* Horizontal Boxes */}
            <div className="box-container">
                {boxData.map(box => (
                    <div key={box.id} className="small-box">
                        {box.title}
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Home;
